INSERT INTO `agreement` VALUES ('1', '<p style=\"text-align: center;\"><img src=\"http://app.hcsjapp.com/upload/2020-08-22/20200822142025234.png\" alt=\"\" width=\"268\" height=\"272\" /></p>\n<p style=\"text-align: center;\">V1.0.0.1版本</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\">Clevel是首个以车为载体的全新社交APP，注册分为三种注册通道，颜值注册、车主注册、黑卡通道。颜值通道会根据的真实用户进行严格的人工审核，确保平台用户质量，车主通道会根据用户注册的车辆品牌、型号等进行严格人工审核，打造真实良好健康的社交环境。</p>\n<p style=\"text-align: center;\">&nbsp;</p>', '<p style=\"text-align: center;\"><strong>用户协议</strong></p>\n<p>特别提示</p>\n<p>湖南上层领域科技有限责任公司（以下简称&ldquo;上层领域&rdquo;）在此特别提醒您（用户）在注册成为用户之前，请认真阅读本《用户协议》（以下简称&ldquo;协议&rdquo;），确保您充分理解本协议中各条款。请您审慎阅读并选择接受或不接受本协议。除非您接受本协议所有条款，否则您无权注册、登录或使用本协议所涉服务。您的注册、登录、使用等行为将视为对本协议的接受，并同意接受本协议各项条款的约束。本协议约定上层领域与用户之间关于&ldquo;Clevel&rdquo;软件服务（以下简称&ldquo;服务&rdquo;）的权利义务。&ldquo;用户&rdquo;是指注册、登录、使用本服务的个人。本协议可由上层领域随时更新，更新后的协议条款一旦公布即代替原来的协议条款，恕不再另行通知，用户可在本软件查阅最新版协议条款。在上层领域修改协议条款后，如果用户不接受修改后的条款，请立即停止使用上层领域提供的服务，用户继续使用上层领域提供的服务将被视为接受修改后的协议。</p>\n<p>一、帐号注册</p>\n<p>1、用户在使用本服务前需要注册一个&ldquo;Clevel&rdquo;帐号。&ldquo;Clevel&rdquo;帐号应当使用手机号码绑定注册，请用户使用尚未与&ldquo;Clevel&rdquo;帐号绑定的手机号码，以及未被上层领域根据本协议封禁的手机号码注册&ldquo;Clevel&rdquo;帐号。上层领域可以根据用户需求或产品需要对帐号注册和绑定的方式进行变更，而无须事先通知用户。</p>\n<p>2、&ldquo;Clevel&rdquo;系基于地理位置的移动社交产品，用户注册时应当授权上层领域公开及使用其地理位置信息方可成功注册&ldquo;Clevel&rdquo;帐号。故用户完成注册即表明用户同意上层领域提取、公</p>\n<p>开及使用用户的地理位置信息。如用户需要终止向其他用户公开其地理位置信息，可自行设置为隐身状态。&ensp;</p>\n<p>3、鉴于&ldquo;Clevel&rdquo;帐号的绑定注册方式，您同意上层领域在注册时将使用您提供的手机号码及/或自动提取您的手机号码及自动提取您的手机设备识别码等信息用于注册。&ensp;</p>\n<p>4、在用户注册及使用本服务时，上层领域需要搜集能识别用户身份的个人信息以便上层领域可以在必要时联系用户，或为用户提供更好的使用体验。上层领域搜集的信息包括但不限于用户的姓名、性别、年龄、出生日期、身份证号、地址、学校情况、公司情况、所属行业、兴趣爱好、常出没的地方、个人说明；上层领域同意对这些信息的使用将受限于第三条用户个人隐私信息保护的约束。&ensp;</p>\n<p>二、服务内容&ensp;</p>\n<p>1、本服务的具体内容由上层领域根据实际情况提供，包括但不限于授权用户通过其帐号进行即时通讯、添加好友、加入群组、关注他人、发布留言。上层领域可以对其提供的服务予以变更，且上层领域提供的服务内容可能随时变更；用户将会收到上层领域关于服务变更的通知。&ensp;</p>\n<p>2、上层领域提供的服务包含免费服务与收费服务。用户可以通过付费方式购买收费服务，具体方式为：用户通过微信、支付宝或其他&ldquo;Clevel&rdquo;平台提供的付费途径支付一定数额的人民币购买&ldquo;Clevel&rdquo;平台的虚拟货币&mdash;&mdash;金钻，然后根据上层领域公布的资费标准以金钻购买用户欲使用的收费服务，从而获得收费服务使用权限。对于收费服务，上层领域会在用户使用之前给予用户明确的提示，只有用户根据提示确认其同意按照前述支付方式支付费用并完成了支付行为，用户才能使用该等收费服务。支付行为的完成以银行或第三方支付平台生成&ldquo;支付已完成&rdquo;的确认通知为准。&ensp;</p>\n<p>3、&ldquo;Clevel&rdquo;平台服务由上层领域提供，在用户遵守本协议特低条款和条件的前提下，为广大用户提供上传、浏览、删除、下载、分享用户信息、文字、图片、照片和视频等功能的信息社交平台。</p>\n<p>4、</p>\n<p>&nbsp;</p>\n<p>三、用户个人隐私信息保护&ensp;</p>\n<p>1、用户在注册帐号或使用本服务的过程中，可能需要填写或提交一些必要的信息，如法律法规、规章规范性文件（以下称&ldquo;法律法规&rdquo;）规定的需要填写的身份信息。如用户提交的信息不完整或不符合法律法规的规定，则用户可能无法使用本服务或在使用本服务的过程中受到限制。</p>\n<p>2、个人隐私信息是指涉及用户个人身份或个人隐私的信息，比如，用户真实姓名、身份证号、手机号码、手机设备识别码、IP地址、用户聊天记录。非个人隐私信息是指用户对本服务的操作状态以及使用习惯等明确且客观反映在上层领域服务器端的基本记录信息、个人隐私信息范围外的其它普通信息，以及用户同意公开的上述隐私信息。&ensp;</p>\n<p>3、尊重用户个人隐私信息的私有性是上层领域的一贯制度，上层领域将采取技术措施和其他必要措施，确保用户个人隐私信息安全，防止在本服务中收集的用户个人隐私信息泄露、毁损或丢失。在发生前述情形或者上层领域发现存在发生前述情形的可能时，将及时采取补救措施。&ensp;</p>\n<p>4、上层领域未经用户同意不向任何第三方公开、&ensp;透露用户个人隐私信息。但以下特定情形除外：&ensp;(1)&ensp;上层领域根据法律法规规定或有权机关的指示提供用户的个人隐私信息；&ensp;(2)&ensp;由于用户将其用户密码告知他人或与他人共享注册帐户与密码，由此导致的任何个人信息的泄漏，或其他非因上层领域原因导致的个人隐私信息的泄露；&ensp;(3)&ensp;用户自行向第三方公开其个人隐私信息；&ensp;(4)&ensp;用户与上层领域及合作单位之间就用户个人隐私信息的使用公开达成约定，上层领域因此向合作单位公开用户个人隐私信息；&ensp;(5)&ensp;任何由于黑客攻击、电脑病毒侵入及其他不可抗力事件导致用户个人隐私信息的泄露。&ensp;</p>\n<p>5、用户同意上层领域可在以下事项中使用用户的个人隐私信息：&ensp;(1)&ensp;上层领域向用户及时发送重要通知，如软件更新、本协议条款的变更；&ensp;(2)&ensp;上层领域内部进行审计、数据分析和研究等，以改进上层领域的产品、服务和与用户之间的沟通；&ensp;(3)&ensp;依本协议约定，上层领域管理、审查用户信息及进行处理措施；&ensp;(4)&ensp;适用法律法规规定的其他事项。&ensp;除上述事项外，如未取得用户事先同意，上层领域不会将用户个人隐私信息使用于任何其他用途。&ensp;</p>\n<p>6、上层领域重视对未成年人的保护。上层领域将依赖用户提供的个人信息判断用户是否为未成年人。任何18岁以下的未成年人不得注册帐号或使用本服务。若用户注册后经发现为未成年人，上层领域将及时采取补救措施。&ensp;</p>\n<p>7、用户确认，其地理位置信息为非个人隐私信息，用户成功注册&ldquo;Clevel&rdquo;帐号视为确认授权上层领域提取、公开及使用用户的地理位置信息。用户地理位置信息将作为用户公开资料之一，由上层领域向其他用户公开。如用户需要终止向其他用户公开其地理位置信息，可随时关闭定位功能。&ensp;</p>\n<p>8、为了改善上层领域的技术和服务，向用户提供更好的服务体验，上层领域或可会自行收集使用或向第三方提供用户的非个人隐私信息。&ensp;</p>\n<p>9、用户提供的个人资料不真实，经核实上层领域有权出于安全考虑对用户账号进行查封处理。</p>\n<p>四、内容规范&ensp;</p>\n<p>1、本条所述内容是指用户使用本服务过程中所制作、上载、复制、发布、传播的任何内容，包括但不限于帐号头像、名称、用户说明等注册信息及认证资料，或文字、语音、图片、视频、图文等发送、回复或自动回复消息和相关链接页面，以及其他使用帐号或本服务所产生的内容。&ensp;</p>\n<p>2、用户不得利用&ldquo;Clevel&rdquo;帐号或本服务制作、上载、复制、发布、传播如下法律、法规和政策禁止的内容：&ensp;(1)&ensp;反对宪法所确定的基本原则的；&ensp;(2)&ensp;危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；&ensp;(3)&ensp;损害国家荣誉和利益的；&ensp;(4)&ensp;煽动民族仇恨、民族歧视，破坏民族团结的；&ensp;(5)&ensp;破坏国家宗教政策，宣扬邪教和封建迷信的；&ensp;(6)&ensp;散布谣言，扰乱社会秩序，破坏社会稳定的；&ensp;(7)&ensp;散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；&ensp;(8)&ensp;侮辱或者诽谤他人，侵害他人合法权益的；&ensp;(9)&ensp;不遵守法律法规底线、社会主义制度底线、国家利益底线、公民合法权益底线、社会公共秩序底线、道德风尚底线和信息真实性底线的&ldquo;七条底线&rdquo;要求的；&ensp;(10)&ensp;含有法律、行政法规禁止的其他内容的信息。&ensp;</p>\n<p>3、用户不得利用&ldquo;Clevel&rdquo;帐号或本服务制作、上载、复制、发布、传播如下干扰&ldquo;Clevel&rdquo;正常运营，以及侵犯其他用户或第三方合法权益的内容：&ensp;(1)&ensp;含有任何性或性暗示的；&ensp;(2)&ensp;含有辱骂、恐吓、威胁内容的；(3)&ensp;含有骚扰、垃圾广告、恶意信息、诱骗信息的；&ensp;(4)&ensp;涉及他人隐私、个人信息或资料的；&ensp;(5)&ensp;侵害他人名誉权、肖像权、知识产权、商业秘密等合法权利的；&ensp;(6)&ensp;含有其他干扰本服务正常运营和侵犯其他用户或第三方合法权益内容的信息。&ensp;</p>\n<p>五、使用规则&ensp;</p>\n<p>1、用户在本服务中或通过本服务所传送、发布的任何内容并不反映或代表，也不得被视为反映或代表上层领域的观点、立场或政策，上层领域对此不承担任何责任。&ensp;</p>\n<p>2、用户不得利用&ldquo;Clevel&rdquo;帐号或本服务进行如下行为：&ensp;(1)&ensp;提交、发布虚假信息，或盗用他人头像或资料，冒充、利用他人名义的；&ensp;(2)&ensp;强制、诱导其他用户关注、点击链接页面或分享信息的；&ensp;(3)&ensp;虚构事实、隐瞒真相以误导、欺骗他人的；&ensp;(4)&ensp;利用技术手段批量建立虚假帐号的；&ensp;(5)&ensp;利用&ldquo;Clevel&rdquo;帐号或本服务从事任何违法犯罪活动的；&ensp;(6)&ensp;制作、发布与以上行为相关的方法、工具，或对此类方法、工具进行运营或传播，无论这些行为是否为商业目的；&ensp;(7)&ensp;其他违反法律法规规定、侵犯其他用户合法权益、干扰&ldquo;Clevel&rdquo;正常运营或上层领域未明示授权的行为。&ensp;</p>\n<p>3、用户须对利用&ldquo;Clevel&rdquo;帐号或本服务传送信息的真实性、合法性、无害性、准确性、有效性等全权负责，与用户所传播的信息相关的任何法律责任由用户自行承担，与上层领域无关。如因此给上层领域或第三方造成损害的，用户应当依法予以赔偿。&ensp;</p>\n<p>4、上层领域提供的服务中可能包括广告，用户同意在使用过程中显示上层领域和第三方供应商、合作伙伴提供的广告。除法律法规明确规定外，用户应自行对依该广告信息进行的交易负责，对用户因依该广告信息进行的交易或前述广告商提供的内容而遭受的损失或损害，上层领域不承担任何责任。&ensp;</p>\n<p>5、除非上层领域书面许可，用户不得从事下列任一行为：&ensp;(1)&ensp;删除软件及其副本上关于著作权的信息；&ensp;(2)&ensp;对软件进行反向工程、反向汇编、反向编译，或者以其他方式尝试发现软件的源代码；&ensp;(3)&ensp;对上层领域拥有知识产权的内容进行使用、出租、出借、复制、修改、链接、转载、汇编、发表、出版、建立镜像站点等；&ensp;(4)&ensp;对软件或者软件运行过程中释放到任何终端内存中的数据、软件运行过程中客户端与服务器端的交互数据，以及软件运行所必需的系统数据，进行复制、修改、增加、删除、挂接运行或创作任何衍生作品，形式包括但不限于使用插件、外挂或非经上层领域授权的第三方工具/服务接入软件和相关系统；&ensp;(5)&ensp;通过修改或伪造软件运行中的指令、数据，增加、删减、变动软件的功能或运行效果，或者将用于上述用途的软件、方法进行运营或向公众传播，无论这些行为是否为商业目的；&ensp;(6)&ensp;通过非上层领域开发、授权的第三方软件、插件、外挂、系统，登录或使用上层领域软件及服务，或制作、发布、传播非上层领域开发、授权的第三方软件、插件、外挂、系统。&ensp;</p>\n<p>六、虚拟货币&ensp;</p>\n<p>1、上层领域将在&ldquo;Clevel&rdquo;平台发行虚拟货币，即&ldquo;金钻/银钻/黑钻&rdquo;。&ldquo;金钻&rdquo;可用于购买&ldquo;Clevel&rdquo;平台的内容消费服务，包括但不限于增送虚拟礼物/增送红包等，除此外，不得用于其他任何用途。该等内容消费服务的价格均以&ldquo;金钻&rdquo;为单位，具体价格信息将由上层领域自行决定并在相关服务页面上显示。内容消费行为一旦发生概不退款；上层领域不承担任何责任。</p>\n<p>2、&ldquo;金钻&rdquo;和人民币的兑换比例是10:1，兑换比例将由上层领域根据运营情况随时变更，并将在用户购买&ldquo;金钻&rdquo;的相关服务页面上显示。&ensp;</p>\n<p>3、用户默认已开通&ldquo;金钻&rdquo;账户，可进行&ldquo;金钻&rdquo;购买和消费。用户可在设置页面查询到&ldquo;金钻&rdquo;余额、购买记录和消费记录。&ldquo;金钻&rdquo;相关信息将不作为公开信息。&ensp;</p>\n<p>4、用户可以通过微信、支付宝或其他&ldquo;Clevel&rdquo;提供的充值途径为&ldquo;金钻&rdquo;账户进行充值。用户使用&ldquo;金钻&rdquo;购买相关收费服务后，可将相关收费服务赠与其他用户。&ensp;</p>\n<p>5、用户确认，&ldquo;金钻&rdquo;一经充值成功，除法律法规明确规定外，在任何情况下不能兑换为法定货币，不能转让他人。除法律法规明确规定外，&ldquo;金钻&rdquo;账户充值完成后，上层领域不予退款。&ensp;6、用户确认，&ldquo;金钻&rdquo;只能用于购买&ldquo;Clevel&rdquo;平台上的各类增值服务，任何情况下不得与上层领域以外的第三方进行&ldquo;金钻&rdquo;交易，亦不得在除&ldquo;Clevel&rdquo;平台以外的第三方平台（如淘宝）上进行交易；如违反前述约定，造成用户或第三方任何损失，上层领域不负任何责任，且如上层领域有理由怀疑用户的&ldquo;金钻&rdquo;账户或使用情况有作弊或异常状况，上层领域将拒绝该用户使用&ldquo;金钻&rdquo;进行支付，直至按本协议约定采取相关封禁措施。&ensp;</p>\n<p>7、用户确认，除法律法规明确规定或本协议另有约定外，用户已购买的任何收费服务不能以任何理由退购（即退换成&ldquo;金钻&rdquo;或法定货币）或调换成其他服务。&ensp;</p>\n<p>七、账户管理&ensp;</p>\n<p>1、&ensp;&ldquo;Clevel&rdquo;帐号的所有权归上层领域所有，用户完成申请注册手续后，获得&ldquo;Clevel&rdquo;帐号的使用权，该使用权仅属于初始申请注册人，禁止赠与、借用、租用、转让或售卖。上层领域因经营需要，有权回收用户的&ldquo;Clevel&rdquo;帐号。&ensp;</p>\n<p>2、用户可以更改、删除&ldquo;Clevel&rdquo;帐户上的个人资料、注册信息及传送内容等，但需注意，删除有关信息的同时也会删除用户储存在系统中的文字和图片。用户需承担该风险。&ensp;</p>\n<p>3、用户有责任妥善保管注册帐号信息及帐号密码的安全，因用户保管不善可能导致遭受盗号或密码失窃，责任由用户自行承担。用户需要对注册帐号以及密码下的行为承担法律责任。用户同意在任何情况下不使用其他用户的帐号或密码。在用户怀疑他人使用其帐号或密码时，用户同意立即通知上层领域。&ensp;4、用户应遵守本协议的各项条款，正确、适当地使用本服务，如因用户违反本协议中的任何条款，上层领域在通知用户后有权依据协议中断或终止对违约用户&ldquo;Clevel&rdquo;帐号提供服务。同时，上层领域保留在任何时候收回&ldquo;Clevel&rdquo;帐号、用户名的权利。&ensp;</p>\n<p>5、如用户注册&ldquo;Clevel&rdquo;帐号后一年不登录，通知用户后，上层领域可以收回该帐号，以免造成资源浪费，由此造成的不利后果由用户自行承担。&ensp;</p>\n<p>八、数据储存&ensp;</p>\n<p>1、上层领域不对用户在本服务中相关数据的删除或储存失败负责。&ensp;</p>\n<p>2、上层领域可以根据实际情况自行决定用户在本服务中数据的最长储存期限，并在服务器上为其分配数据最大存储空间等。用户可根据自己的需要自行备份本服务中的相关数据。&ensp;</p>\n<p>3、如用户停止使用本服务或本服务终止，上层领域可以从服务器上永久地删除用户的数据。本服务停止、终止后，上层领域没有义务向用户返还任何数据。&ensp;</p>\n<p>九、风险承担&ensp;</p>\n<p>1、用户理解并同意，&ldquo;Clevel&rdquo;仅为用户提供信息分享、传送及获取的平台，用户必须为自己注册帐号下的一切行为负责，包括用户所传送的任何内容以及由此产生的任何后果。用户应</p>\n<p>对&ldquo;Clevel&rdquo;及本服务中的内容自行加以判断，并承担因使用内容而引起的所有风险，包括因对内容的正确性、完整性或实用性的依赖而产生的风险。上层领域无法且不会对因用户行为而导致的任何损失或损害承担责任。&ensp;如果用户发现任何人违反本协议约定或以其他不当的方式使用本服务，请立即向上层领域举报或投诉，上层领域将依本协议约定进行处理。&ensp;</p>\n<p>2、用户理解并同意，因业务发展需要，上层领域保留单方面对本服务的全部或部分服务内容变更、暂停、终止或撤销的权利，用户需承担此风险。&ensp;</p>\n<p>十、知识产权声明&ensp;</p>\n<p>1、除本服务中涉及广告的知识产权由相应广告商享有外，上层领域在本服务中提供的内容（包括但不限于网页、文字、图片、音频、视频、图表等）的知识产权均归上层领域所有，但用户在使用本服务前对自己发布的内容已合法取得知识产权的除外。&ensp;</p>\n<p>2、除另有特别声明外，上层领域提供本服务时所依托软件的著作权、专利权及其他知识产权均归上层领域所有。&ensp;</p>\n<p>3、上层领域在本服务中所涉及的图形、文字或其组成，以及其他上层领域标志及产品、服务名称（以下统称&ldquo;上层领域标识&rdquo;），其著作权或商标权归上层领域所有。未经上层领域事先书面同意，用户不得将上层领域标识以任何方式展示或使用或作其他处理，也不得向他人表明用户有权展示、使用、或其他有权处理上层领域标识的行为。&ensp;</p>\n<p>4、上述及其他任何上层领域或相关广告商依法拥有的知识产权均受到法律保护，未经上层领域或相关广告商书面许可，用户不得以任何形式进行使用或创造相关衍生作品。&ensp;</p>\n<p>十一、法律责任&ensp;</p>\n<p>1、如果上层领域发现或收到他人举报或投诉用户违反本协议约定的，上层领域有权不经通知随时对相关内容，包括但不限于用户资料、聊天记录进行审查、删除，并视情节轻重对违规帐号处以包括但不限于警告、帐号封禁&ensp;、设备封禁&ensp;、功能封禁&ensp;的处罚，且通知用户处理结果。&ensp;</p>\n<p>2、因违反用户协议被封禁的用户，可以致电客服查询封禁期限或申请解封，并在封禁期限届满后自助解封。其中，被实施功能封禁的用户会在封禁期届满后自动恢复被封禁功能。被封禁用户可向客服提交申诉，上层领域将对申诉进行审查，并自行合理判断决定是否变更处罚措施。&ensp;</p>\n<p>3、用户理解并同意，上层领域有权依合理判断对违反有关法律法规或本协议规定的行为进行处罚，对违法违规的任何用户采取适当的法律行动，并依据法律法规保存有关信息向有关部门报告等，用户应承担由此而产生的一切法律责任。&ensp;</p>\n<p>4、用户理解并同意，因用户违反本协议约定，导致或产生的任何第三方主张的任何索赔、要求或损失，包括合理的律师费，用户应当赔偿上层领域与合作公司、关联公司，并使之免受损害。&ensp;</p>\n<p>十二、不可抗力及其他免责事由&ensp;</p>\n<p>1、用户理解并确认，在使用本服务的过程中，可能会遇到不可抗力等风险因素，使本服务发生中断。不可抗力是指不能预见、不能克服并不能避免且对一方或双方造成重大影响的客观事件，包括但不限于自然灾害如洪水、地震、瘟疫流行和风暴等以及社会事件如战争、动乱、政府行为等。出现上述情况时，上层领域将努力在第一时间与相关单位配合，及时进行修复，但是由此给用户或第三方造成的损失，上层领域及合作单位在法律允许的范围内免责。&ensp;</p>\n<p>2、本服务同大多数互联网服务一样，受包括但不限于用户原因、网络服务质量、社会环境等因素的差异影响，可能受到各种安全问题的侵扰，如他人利用用户的资料，造成现实生活中的骚扰；用户下载安装的其它软件或访问的其他网站中含有&ldquo;特洛伊木马&rdquo;等病毒，威胁到用户的计算机信息和数据的安全，继而影响本服务的正常使用等等。用户应加强信息安全及使用者资料的保护意识，要注意加强密码保护，以免遭致损失和骚扰。&ensp;</p>\n<p>3、用户理解并确认，本服务存在因不可抗力、计算机病毒或黑客攻击、系统不稳定、用户所在位置、用户关机以及其他任何技术、互联网络、通信线路原因等造成的服务中断或不能满足用户要求的风险，因此导致的用户或第三方任何损失，上层领域不承担任何责任。&ensp;</p>\n<p>4、用户理解并确认，在使用本服务过程中存在来自任何他人的包括误导性的、欺骗性的、威胁性的、诽谤性的、令人反感的或非法的信息，或侵犯他人权利的匿名或冒名的信息，以及伴随该等信息的行为，因此导致的用户或第三方的任何损失，上层领域不承担任何责任。&ensp;</p>\n<p>5、用户理解并确认，上层领域需要定期或不定期地对&ldquo;CLEVEL&rdquo;平台或相关的设备进行检修或者维护，如因此类情况而造成服务在合理时间内的中断，上层领域无需为此承担任何责任，但上层领域应事先进行通告。&ensp;</p>\n<p>6、上层领域依据法律法规、本协议约定获得处理违法违规或违约内容的权利，该权利不构成上层领域的义务或承诺，上层领域不能保证及时发现违法违规或违约行为或进行相应处理。&ensp;</p>\n<p>7、用户理解并确认，对于上层领域向用户提供的下列产品或者服务的质量缺陷及其引发的任何损失，上层领域无需承担任何责任：&ensp;(1)&ensp;上层领域向用户免费提供的服务；&ensp;(2)&ensp;上层领域向用户赠送的任何产品或者服务。&ensp;8、在任何情况下，上层领域均不对任何间接性、后果性、惩罚性、偶然性、特殊性或刑罚性的损害，包括因用户使用&ldquo;CLEVEL&rdquo;或本服务而遭受的利润损失，承担责任（即使上层领域已被告知该等损失的可能性亦然）。尽管本协议中可能含有相悖的规定，上层领域对用户承担的全部责任，无论因何原因或何种行为方式，始终不超过用户因使用上层领域提供的服务而支付给上层领域的费用(如有)。&ensp;</p>\n<p>十三、服务的变更、中断、终止&ensp;</p>\n<p>1、鉴于网络服务的特殊性，用户同意上层领域有权随时变更、中断或终止部分或全部的服务（包括收费服务）。上层领域变更、中断或终止的服务，上层领域应当在变更、中断或终止之前通知用户，并应向受影响的用户提供等值的替代性的服务；如用户不愿意接受替代性的服务，如果该用户已经向上层领域支付的&ldquo;金钻&rdquo;，上层领域应当按照该用户实际使用服务的情况扣除相应&ldquo;金钻&rdquo;之后将剩余的&ldquo;金钻&rdquo;退还用户的&ldquo;金钻&rdquo;账户中。&ensp;</p>\n<p>2、如发生下列任何一种情形，上层领域有权变更、中断或终止向用户提供的免费服务或收费服务，而无需对用户或任何第三方承担任何责任：&ensp;(1)&ensp;根据法律规定用户应提交真实信息，而用户提供的个人资料不真实、或与注册时信息不一致又未能提供合理证明；&ensp;(2)&ensp;用户违反相关法律法规或本协议的约定；&ensp;(3)&ensp;按照法律规定或有权机关的要求；&ensp;(4)&ensp;出于安全的原因或其他必要的情形。&ensp;</p>\n<p>十四、&ldquo;提现&rdquo;服务说明与免责条款&ensp;</p>\n<p>1、用户通过礼物/红包等所获的收益为&ldquo;银钻&rdquo;，用户可使用&ldquo;银钻&rdquo;兑换&ldquo;金钻&rdquo;或&ldquo;黑钻&rdquo;，平台将收取一定手续费。</p>\n<p>2、收获的&ldquo;银钻&rdquo;兑换为&ldquo;黑钻&rdquo;可以进行提现，提现比例为10:1，提现按用户自身参与活动或其他方式所获提现比例进行结算（无法提现部分为平台手续费及提现所缴税费）。提现比例将由上层领域根据经营情况进行变更，并将在用户礼物收益的相关服务页面上显示。</p>\n<p>3、用户提现比例需绑定银行卡，经用户操作无误及确定后进行提现操作，若用户操作失误造成损失，平台不承担责任。</p>\n<p>4、用户所获礼物收益提现后为税后酬劳。</p>\n<p>十五、其他&ensp;</p>\n<p>1、上层领域郑重提醒用户注意本协议中免除上层领域责任和限制用户权利的条款，请用户仔细阅读，自主考虑风险。未成年人应在法定监护人的陪同下阅读本协议。</p>\n<p>2、本协议的效力、解释及纠纷的解决，适用于中华人民共和国法律。若用户和上层领域之间发生任何纠纷或争议，首先应友好协商解决，协商不成的，用户同意将纠纷或争议提交上层领域住所地有管辖权的人民法院管辖。&ensp;</p>\n<p>3、本协议的任何条款无论因何种原因无效或不具可执行性，其余条款仍有效，对双方具有约束力。</p>\n<p>4、关于Clevel平台社交的版权问题，欢迎相关版权人及时与我方&ldquo;上层领域&rdquo;联系，洽谈版权合作事宜。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '<p>按等级获得不同的特权VIP1(入门)，每充值1000元 等级提升1</p>\n<p>VIP权限&nbsp;</p>\n<ol>\n<li>每日基础（车主/灵魂匹配）匹配人数/20人。</li>\n<li>可添加20名好友，VIP每提升1级额外增加1人。</li>\n<li>发起线下聚会（3人以下）。</li>\n<li>5级以上开通HC大咖秀功能。</li>\n<li>10级开通线下聚会功能 3-5人，可在世界频道隐藏自身信息。&nbsp;</li>\n<li>10级以上不限匹配数量。</li>\n<li>20级可发起5人以上聚会。</li>\n<li>50级，不限好友数量。</li>\n</ol>', '<p>一级好友奖励</p>\n<p>通过好友邀请码注册的，注册成功好友（颜值用户）收礼物（银钻）的10%，平台额外奖励给上级。注册成功好友（车主/黑卡用户）充值（金钻）的10%，平台额外奖励给上级。</p>\n<p>二级好友奖励</p>\n<p>二级邀请人充值（金钻）/收礼物（银钻）的2%，平台额外奖励给用户。</p>\n<p>&nbsp;</p>\n<p>！ 注意</p>\n<p>邀请人注册，有且仅有二级关联，超过二级则无关联。</p>\n<p>&nbsp;</p>', '<p style=\"text-align: center;\"><img src=\"http://app.hcsjapp.com/upload/2020-08-22/20200822145726906.png\" alt=\"\" width=\"397\" height=\"319\" /></p>\n<p style=\"text-align: center;\">VVIP 24小时私人管家</p>\n<p style=\"text-align: center;\">1V1专属服务</p>\n<p style=\"text-align: center;\"><img src=\"http://app.hcsjapp.com/upload/2020-08-22/20200822145741379.png\" alt=\"\" width=\"123\" height=\"176\" /></p>\n<p style=\"text-align: center;\">4个月会员权限</p>\n<p style=\"text-align: center;\"><img src=\"http://app.hcsjapp.com/upload/2020-08-22/20200822145754127.png\" alt=\"\" width=\"273\" height=\"198\" /></p>\n<p style=\"text-align: center;\">赠送38888金钻</p>\n<p style=\"text-align: center;\">&nbsp;</p>', '<p style=\"text-align: center;\"><strong>Clevel应用隐私政策</strong></p>\n<p>尊敬的用户：</p>\n<p>Clevel应用是由湖南上层领域科技有限责任公司（以下简称&ldquo;湖南上层领域&rdquo;）为您提供的一款智能语音服务产品。湖南上层领域科技有限责任公司十分尊重您的个人信息和数据，并会尽全力保护您的个人信息和数据的安全可靠。本政策仅适用于Clevel应用收集和存储的用户信息和数据。</p>\n<p>请在使用Clevel应用前，务必仔细阅读并了解和同意《Clevel 应用的隐私政策》。该政策规定了您在使用 Clevel应用时我们将如何收集、使用、披露、处理和保护您提供给我们的信息。</p>\n<p>如果我们需要您提供某些信息用于在使用该产品时验证您的身份、以及向我们的第三方服务供应商连接服务时，我们会严格遵守该隐私政策来使用这些信息。如果您已经开始使用Clevel应用，就表示您已经阅读、许可并接受该隐私政策中所描述的所有条款，以及我们今后随时做出的任何变更。</p>\n<p>另外，您需要承诺在您开始使用本产品时已经是成年人，如果您是未成年人，需要您的监护人同意您使用本产品并同意相关的服务条款和隐私政策。</p>\n<p>（1）Clevel 应用怎样收集并使用您的信息（包括个人信息）个人信息是指以电子或者其他方式记录的能够单独或者与其他信息结合识别特定自然人身份或者反映特定自然人活动情况的各种信息，其中属于个人敏感信息的包括个人生物识别信息（例如指纹、面部、声纹）、身份证件号码、银行账号、财产信息、交易信息、行踪轨迹（例如居住和办公地址）等。</p>\n<p>我们只会以该声明中所列出的目的，来收集和使用您的信息：</p>\n<p>1-1.语音唤醒（仅针对支持该功能的机型）</p>\n<p>语音唤醒的功能需要您在Clevel应用中设置唤醒词，我们会记录您的声音，进而获取其中的声纹信息（该信息属于个人敏感信息）。我们会将您在设置唤醒词时的唤醒词声音和声纹信息保存在手机中。为了确保语音唤醒功能的安全性和用户体验，Clevel应用会将用户在语音唤醒时输入的音频声纹与保存在手机中的音频声纹在本地进行匹配。为了提高语音唤醒的精准率，我们也会将用户每次语音唤醒时的唤醒词音频保存在手机本地，当手机处于 WIFI 网络，我们会将前一天的所有语音唤醒词音频和识别结果经过去标识化处理上传到云端，您与之关联的个人信息不会进行上传。</p>\n<p>若您不提供上述信息，将无法使用语音唤醒的功能。您可通过进入&ldquo;设置&rdquo;&gt;Clevel应用&gt;&ldquo;Clevel应用能力设置&rdquo;&gt;&ldquo;语音助手&rdquo;&gt;&ldquo;语音唤醒&rdquo;，来关闭语音唤醒功能。您也可以通过进入&ldquo;设置&rdquo;&gt;&ldquo;更多设置&rdquo;&gt;&ldquo;应用管理&rdquo;，点击右上角&ldquo;更多&rdquo;&gt;&ldquo;显示系统进程&rdquo;&gt;&ldquo;语音唤醒&rdquo;&gt; &ldquo;存储&rdquo;，点击清除数据，就可以删除您的唤醒词声音和声纹信息，同时语音唤醒的功能也会被关闭。</p>\n<p>1-2.语音识别</p>\n<p>该功能是将您说出的话（音频）转化为文本，用于 Clevel 应用分析和理解，从而执行您想要完成的命令。本产品中的语音识别服务由湖南上层领域以及湖南上层领域有限责任公司联合提供服务，</p>\n<p>我们需要收集如下信息：位置信息、通讯录中的联系人姓名、本地已安装的应用名称、您设定的教学命令和组合命令的触发语句、您在使用该产品过程中说出的语音内容/音频。这些信息会经过加密处理后上传至湖南上层领域以及第三方服务提供商的云端进行语音识别处理。</p>\n<p>1-3.语义理解</p>\n<p>该功能是将您转化为文本后的命令进行语义层面的分析和理解，从而执行相应的命令。本产品中的语义理解服务由湖南上层领域等第三方服务提供商联合提供服务，我们需要收集如下信息：您在使用该产品时所产生的指令、会话等信息（例如语音所转化后的文字信息以及手动键盘输入的文字信息）、当前地理位置、获知当前前台应用的名称以及运</p>\n<p>行状态等信息（例如前台是音乐应用，以及音乐的播放状态）、这些信息会经过脱敏处理后上传至湖南上层领域以及第三方服务提供商的云端进行语义理解处理以及辅助会话的上下文理解。</p>\n<p>1-4.模拟点击</p>\n<p>该功能旨在将您的语音命令转化成与用手指一样的模拟操作，因此我们需要收集如下信息：界面控件、文本、图像的位置。这些信息不会被保存，并且仅在手机本地处理。同时，我们需要开启&ldquo;语音助手&rdquo;的辅助功能权限，用以辅助获取您输入的信息以及屏幕上的内容。为了提高模拟点击动作的准确率，Clevel应用需要在有网络连接的情况下（WLAN 或移动网络）自动更新模拟点击的配置插件。</p>\n<p>1-5.拨打电话与发送信息</p>\n<p>Clevel应用为了能够实现拨打电话以及发送信息的功能，我们需要收集您的以下信息：通讯录中的联系人姓名、假名化后的设备标识符、移动网络代码和移动设备国家代码。您的联系人的组别属性、名称以及电话号码仅存储在本地进行处理，不会上传到服务器。</p>\n<p>1-6.查询天气和预约任务</p>\n<p>Clevel 应用为了能够实现查询天气和预约任务中跟地点相关的功能，我们需要收集您的地理位置信息，包括但不限于：当前位置、常访问位置、居住地址以及办公/学习位置。</p>\n<p>1-7.查询与设置日程</p>\n<p>Clevel 应用为了能够实现查询与设置日程的功能，我们需要收集并处理您的日历信息。该信息的收集和处理仅在本地完成，用于查询和设置您的日程。</p>\n<p>1-8.个人教学命令</p>\n<p>在教学功能中，为了将您的语音命令模拟成您的实际手指操作，我们需要开启&ldquo;语音助手&rdquo;的辅助功能权限，用以辅助获取您输入的信息以及屏幕上的内容。</p>\n<p>1-9.调用第三方应用</p>\n<p>为了提供更为丰富的服务，湖南上层领域会通过云端与第三方应用开放接入接口，由三方服务方/应用为您提供相应的服务（例如：导航、订机票等）。我们会将第三方服务方/应用所需要的信息提供给对方，包括但不限于：语音识别结果（文字信息）、位置信息。</p>\n<p>在使用的功能涉及第三方时，可能会跳转到第三方应用或网站上，我们强烈建议您仔细阅读该第三方的服务条款和隐私政策，因为我们无法控制第三方应用或网站，也不为第三方损害您的权益承担任何责任。</p>\n<p>1-10.语音识别的精准度训练</p>\n<p>为了给您提供更精准的语音识别服务，我们需要收集如下信息：位置信息，假名化后的设备标识符、移动网络代码和移动设备国家代码、您提供的语音内容以及相应的识别结果。您的以上信息将会保存在湖南上层领域有限责任公司云端，用于进行机器学习训练。您可通过进入&ldquo;设置&ldquo;&gt;&rdquo;更多设置&ldquo;&gt;&ldquo;用户体验改进计划&rdquo;， 点击&ldquo;加入用户体验改进计划&rdquo;的开关来选择是否提供数据供我们进行训练。（该开关并不是只用于管理Clevel应用的相关信息）。</p>\n<p>1-11.微信自动播报</p>\n<p>微信播报功能需要获取读取通知权限，通过识别、加密上传手机通知栏内容，进行语音播报。通知栏内容仅用于实现微信播报功能、执行完毕后即时删除，不会被存储或用于其他目的。若您启用该功能，视为您已理解并理解上述内容。上述权限仅在您启用功能期间调用，您可以随时关闭。</p>\n<p>1-12.宣传推广</p>\n<p>为了开展新闻报道或运营活动，需要提供去标识化的信息进行展示。若您不能提供上述目的中任一一项所需的信息（1-1 和 1-10 除外），则 Clevel应用都无法正常使用。</p>\n<p>（2）保留政策与数据存储</p>\n<p>我们会在符合法律法规要求，以及实现信息收集目的的必要期限内，保存上述收集的您的个人信息。超过上述期限后，我们将不会再保留个人信息或对个人信息进行匿名化。</p>\n<p>2-1.数据存储地点</p>\n<p>我们在本产品和服务中所收集和产生的个人信息，将存储在中华人民共和国境内。</p>\n<p>2-2.数据存储期限</p>\n<p>我们仅为实现上述目的所需要的时间来保留您的个人信息，并在超出保留时间后删除或匿名化处理您的个人信息，但法律法规另有要求的除外。</p>\n<p>在 Clevel应用中，您的个人数据具体留存时间如下：为了持续优化语音识别的准确率从而改进用户体验，我们会采集假名化后的设备标识符、位置信息、移动网络代码和移动设备国家代码、语音内容及相应语言识别结果，数据的存储期限至少 6 个月。</p>\n<p>我们也会将您的部分个人数据上传至服务器以及提供给第三方服务商用于完成语音识别服务，其中语音内容在第三方的默认储存期限为 3 个月。</p>\n<p>另外，如果我们的产品或服务发生了停止运营的情况时，我们将以推送通知、公告等形式告知您，并在合理的期限内删除您的个人信息或进行匿名化处理。</p>\n<p>（3）优先顺序</p>\n<p>本隐私政策针对Clevel应用的应用软件以及其提供的相关服务，如果本隐私政策与 湖南上层领域隐私政策之间存在不一致，以本隐私政策为准；若本隐私政策未包含（约定）的相关内容，则以湖南上层领域隐私政策中包含（约定）的为准。</p>\n<p>（4）联系我们</p>\n<p>如果您对本隐私政策有任何疑问、意见或建议，或者对我们收集、使用或披露您的个人信息有任何问题，请拨打我们的客服电话0731-85206798或登录湖南上层领域官网</p>\n<p>https://www.hcsjapp.com/通过在线客服的方式与我们联系。</p>\n<p>（5）更新说明</p>\n<p>湖南上层领域保留随时更新本声明的权利，当声明发生修改时，我们会通过弹窗或通知的方式告知您变更后的声明。如您继续使用我们的服务，即视为您同意我们的变更后的隐私政策，我们才会按照更新的声明收集、使用、存储您的个人信息。</p>\n<p>本声明自更新之日起生效</p>\n<p style=\"text-align: right;\">最近的更新日期：2020年08月21日</p>\n<p style=\"text-align: right;\">湖南上层领域有限责任公司</p>\n<p style=\"text-align: right;\">&nbsp;</p>', '2020-04-24 14:56:58');
